import React from 'react';
// import './style.less'
import Drag from '../../components/Drag'

export default function Overview() {

  return (
    <div>
      <Drag sizeOptions={['small', 'middle', 'great', 'relax', 'giant']} options={{title: '第一个dragDiv'}}>
        <div style={{height: '100px',width: '100px', backgroundColor:'orange'}}></div>
      </Drag>
      <Drag sizeOptions={['small', 'middle', 'great', 'relax', 'giant']} options={{title:'第二个dragDiv',paddingNum: 2}}>
        <div style={{height: '100px',width: '100px', backgroundColor:'red'}}></div>
      </Drag>
      <Drag sizeOptions={['small', 'middle', 'great', 'relax', 'giant']} options={{title:'第三个dragDiv',paddingNum: 15}}>
        <div style={{height: '100px',width: '100px', backgroundColor:'green'}}></div>
      </Drag>
      <Drag sizeOptions={['small', 'middle', 'great', 'relax', 'giant']} options={{title:'第四个dragDiv'}}>
        <div style={{height: '100px',width: '100px', backgroundColor:'blue'}}></div>
      </Drag>
    </div>
  );
}
